  console.log("Images_preview");
  console.log(Images);

  const Images_Show = Images.map((Element, index) => {
    // console.log(index);
    if (index <= 5) {
      return <img key={index} src={Element} />;
    } else {
      console.log(index);
      return;
    }
  });

  return <div class="ui mini images">{Images_Show}</div>;
};

export default Images_preview;
